import React from "react";

import styles from "./EditEnvelopesForm.module.css";

const EditEnvelopeForm = ({ }) => {
  return (
    <div>
      <div className={styles.backgroundHider}>
      </div >
      <div className={styles.editEnvelopeForm}>
        <h1>Envelopes</h1>
      </div>
    </div>
  );
};

export default EditEnvelopeForm;
